import React from "react";

export default function Game(props) {
  const { join_id, players } = props;
  return (
    <div>
      <div>ID: {join_id}</div>

      <div className="flex">
        <div className="mr-10">
          {[15, 16, 17, 18, 19, 20, "bull"].map(value => {
            return <div className="score__item">{value}</div>;
          })}
        </div>
        {players.map(({ id, name, score }) => (
          <div key={id} className="mr-10">
            <div>{name}</div>
            <div>{score[14]}</div>
            <div>{score[15]}</div>
            <div>{score[16]}</div>
            <div>{score[17]}</div>
            <div>{score[18]}</div>
            <div>{score[19]}</div>
            <div>{score[20]}</div>
            <div>{score["bull"]}</div>
          </div>
        ))}
      </div>
    </div>
  );
}
